import React , {Component} from 'react'
import axios from 'axios';

class Blog extends Component{
    state = {
        users : [],
        url:[]
    }
    componentDidMount(){
        axios.get('https://jsonplaceholder.typicode.com/users').then(res => {
            this.setState({
                users : res.data
            })
        });
        axios.get('https://jsonplaceholder.typicode.com/photos').then(photos => {
            this.setState({
                url : photos.photo
            })
            console.log(photos)
        });
    }

    
    render(){
        const func = this.state.users.map(line => {
            return(
                <li>{line.name}</li>
            );
        })
        // const funcUrl = this.state.users.map(line => {
        //     return(
        //         <li>{line.name}</li>
        //     );
        // })
        return(
            <div>
                <h2>Blog</h2>
                <p>This section from Blog</p>
                <div>
                    <ul className='ul-blog'>
                        {func}
                    </ul>
                </div>
            </div>
        );
    }
}

export default Blog;
